# ## Accuracy
# 
# Another simple classification metric is Accuracy. Accuracy is a composition of the Confusion Matrix cells in which we consider the percentage of guesses that were correctly made. This might seem to be a great metric at first sight, however, it presents a strong shortcoming that we must be aware of when engineering a solution.
# 
# Succinctly, we can translate this metric to the following question: out of everything my model has predicted, what percentage was actually correct? Mathematically,
# 
# \begin{equation}
# \frac{tp+tn}{tp+tn+fp+fn}
# \end{equation}


# CELL ********************

print(f"The accuracy score was {accuracy_score(Y_test, preds):.2f}")

# METADATA ********************

# META {
# META   "language": "python",
# META   "language_group": "jupyter_python"
# META }

# MARKDOWN ********************

# The Accuracy metric pointed to a perfect classification rate, even though we've checked with the aid of Confusion Matrix that out model isn't this clever. So the main limitation here is the inability to deal with skewed classes. In other words, when one class presents a strong predominance, we should expect accuracy to conclude that we have built a skilled solution even though we only predicted the most frequent class. For example, consider a model that literally predicts no-fraud to every record

